	 ('BOLSA PARA AGUA CALIENTE CON FORRO',NULL,0,0,0,0,19.23,NULL,25.0,8.0,'ACTIVO','PIEZAS',NULL,'CHINA',NULL,NULL,'','','1710518009Captura de pantalla 2024-03-15 114751.jpg','La bolsa de agua caliente se usa en tratamientos medicinales de salud y en la vida diaria comúnmente para dar calor.La temperatura del agua de la bolsa caliente debería estar sobre los 90 grados, llenar la bolsa de agua caliente unos 2/3 de su capacidad sin sobrepasar.Cuando use la bolsa con niños procure dejarla un poco alejada de ellos.Después de llenarla de agua, saque el aire y apriete el tapón, ya que el vapor de agua hará que se fiche al poco rato, compruebe que esté bien cerrada y no pierda agua pues de lo contrario podría quemar al paciente y agravaría su situación.','Insumos Médicos','Insumos Hospitalarios',NULL,NULL,NULL),
	 ('FAJA ABDOMINAL PARA NIÑOS',NULL,0,0,0,0,15.38,NULL,20.0,8.0,'ACTIVO','UNIDADES',NULL,'',NULL,NULL,'','','1710519139Captura de pantalla 2024-03-15 121207.jpg','La faja para la cintura es la solución mas confortable para proteger y hacer discreta la bolsa para la ostomia de tu niño. Este especial modelo prevé un bolsillo interno que contiene completamente la bolsa, esta ultima es colocada a través de una especial apertura hecha con corte láser. En el fondo del bolsillo tiene una apertura doblada que permite extraer cómodamente la bolsa para vaciarla, sin tener que quitarse la faja. Es indicada para todo tipo de ostomia (colostomia, ileostomia, urostomia) y para las ostomia posicionadas a la derecha y también a la izquierda. Este modelo es indicado para quien tiene solo una bolsa. Esta disponible la Funda para la bolsa en combinación a la faja, para una mayor discreción y para hacer la bolsa mas bonita.','Insumos Médicos','Prot - Ortopedia',NULL,NULL,NULL),
